[Form]
public class InventTransferParmPick extends FormRun
{
    InventDimCtrl_Frm_Mov_TransferOrder     inventDimFormSetup;
    InventDimCtrl_Frm_SimpleRightClick      inventDimFormSetupPickList;

    InventTransferMultiPick                 inventTransferMultiPick;
    QueryBuildRange                         parmQuery;

    PmfFormCtrl                             formCtrl;

    QueryBuildRange                         qbrInventTransferParmUpdateParmId;

}

void doReselect()
{
    InventTransferParmTable  inventTransferParmTableTmp = inventTransferParmTable.data();

    inventTransferParmTable_ds.executeQuery();

    if (inventTransferParmTableTmp.RecId)
    {
        element.args().lookupRecord(inventTransferParmTableTmp);
        inventTransferParmTable_ds.research(false);
    }
}

public void init()
{
    InventDimParm   inventDimParm;

    inventTransferMultiPick = element.args().caller().runBase();

    formCtrl = PdsFormCtrl_InventTransferParmPick::newFromForm(element);

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);

    inventDimFormSetupPickList  = InventDimCtrl_Frm_SimpleRightClick::newFromForm(element);
    inventDimParm.InventSiteIdFlag      = NoYes::Yes;
    inventDimParm.InventLocationIdFlag  = NoYes::Yes;
    inventDimFormSetupPickList.parmDimParmLockedRightClick(inventDimParm.data());

    if (inventTransferMultiPick.parmCalledFromReleaseOrder())
        inventTransferParmTable_DS.object(fieldnum(InventTransferParmTable,PickUpdateQty)).enabled(false);

    if (formCtrl)
    {
        formCtrl.setDatasources(
            inventTransferParmLine,
            inventTransferParmTable,
            inventDim);
        formCtrl.initPost();
    }
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventTransferLine  inventTransferLine = InventTransferLine::findTransIdShip(inventTransferParmLine.InventTransId);
    InventMovement      localMovement = InventMovement::construct(inventTransferLine);

    if (!inventDimFormSetup)
        inventDimFormSetup  = InventDimCtrl_Frm_Mov_TransferOrder::newFromFormMovement(element,localMovement);

    InventTransferTable::formUpdateDesign(inventDimFormSetup,localMovement,mode,true);
}

public int active()
{
    int ret;
    InventDimParm   inventDimParm;

    ret = super();

    element.ctrlPrintButton(inventTransferParmTable.PrintTransferPickingList);

    InventDimFixedClass::inventDimFixed2InventDimParm(inventTransferParmTable.InventDimFixedPickList,inventDimParm);
    inventDimFormSetupPickList.parmDimParmVisibleGrid(inventDimParm,true);

    return ret;
}

public void  create(boolean append = false)
{
    LineNum lineNumSave;

    super(append);

    lineNumSave = inventTransferParmTable.LineNum;

    inventTransferMultiPick.initParmBuffer(inventTransferParmTable);

    inventTransferParmTable.LineNum = lineNumSave;
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    if (formCtrl)
    {
        formCtrl.dataSourceActivePost();
    }

    return ret;
}

/// <summary>
/// Complete standard modification logic and then run logic form custom formControl.
/// </summary>
public void modified()
{
    super();

    inventTransferParmLine_ds.refresh();
}

public void modified()
{
    super();

    if (formCtrl)
    {
        formCtrl.fieldModified(fieldnum(InventTransferParmLine, QtyShipNow));
        inventTransferParmLine_ds.refresh();
    }
}

public void executeQuery()
{
    if (inventTransferMultiPick.parmId())
    {
        qbrInventTransferParmUpdateParmId.value(queryValue(inventTransferMultiPick.parmId()));
    }
    else
    {
        qbrInventTransferParmUpdateParmId.value(SysQuery::valueEmptyString());
    }
    super();
}
